I’m soooo in love with my new babe.😍 Finally added a 19+ zx6r to my little moto family. My 2004 zx6r has been so good to me over the last 6 and a half years but she’s getting old and tired and it’s time for me to be riding a fresh bike with more power and capability. 💪🏼

We are having a blast and getting real comfy together up here at #suckafreesesh in Washington state. ☺️ Loving the vibes and especially the views! 🏞

